import React from "react";

function Table() {
  return (
    <div>
  <table class="profileTable1" border="1">
    <thead>
      <tr>
        <td class="profileText"><h2 class="profileText">Profile</h2></td>
      </tr>
    </thead>
    <tbody>
    <tr align="center">
        <td rowspan="2"><strong>Name</strong></td>
        <td>Korean</td>
        <td>이재성</td>
      </tr>
    </tbody>    
  </table>
</div>
  );
}

export default Table;
